<script tyle="text/js">
  var tl = new TimelineMax({ repeat: -1 })
  .to([".flowers__dot1", ".flowers__dot2", ".flowers__dot3"], 2, { opacity: 0.1 , ease:Power0.easeOut })
  .to([".flowers__dot1", ".flowers__dot2", ".flowers__dot3"], 2, { opacity: 1 , ease:Power0.easeOut });

  var bee1 = new TimelineMax({ repeat: -1 })
  .to(".bees__1", .5, { top: "-=30px", left: "-=30px", rotation: -20, ase:Power0.easeNone})
  .to(".bees__1", .5, { top: "+=30px", left: "-=30px", rotation: -120, ase:Power0.easeNone})
  .to(".bees__1", 1, { left: "+=60px", rotation: -180, ase:Power0.easeNone});

  var bee2 = new TimelineMax({ repeat: -1 })
  .to(".bees__2", 2, { top: "+=30px", left: "+=10px", rotation: 45, ase:Power3.easeNone})
  .to(".bees__2", 2, { top: "-=30px", left: "-=10px", rotation: 0, ase:Power3.easeNone});

  var bee3 = new TimelineMax({ repeat: -1 })
  .to(".bees__3", 10, {bezier:{type:"curviness:1.25", values:[{x:0, y:0}, {x:-150, y:-100}, {x:50, y:-120}, {x:-80, y:50}, {x:-10, y:0}, {x:0, y:0}], autoRotate:["x","y","rotation", 360, false]}, ease:Power2.easeInOut});

  var tl = new TimelineMax({ repeat: -1 })
  .to([".bird__note1", ".bird__note2", ".bird__note3"], 3, { opacity: 0, left: "+=30px", top: "-=20px", ease:SteppedEase.config(3)}).delay(.5);

  var bird_tail = new TimelineMax({ repeat: -1 })
  .to(".bird__tail", 2, { rotationX: 60, ease: Circ.easeInOut, yoyo: true, repeat: -1});
</script>

<style tyle="text/css">
$bg: #D9E0E7;
$grass: #A0BE38;
$tree-body: #91633F;
$tree-top: #EAD292;
$tree-shade: #6C4B35;
$tree-shade2: #C29C57;
$tree-shade3: #AB814E;
$tree-shade4: #855737;
$tree-trunk: #6D4B36;
$tree-eye: #392F21;
$tree-brows: #6C4B31;
$stem: #7C9A2C;
$stem-shadow: #678127;
$stem-light: #A0BE38;
$petal-pink: #E274A4;
$petal-pink-shadow: #B75379;
$petal-orange: #E07335;
$petal-yellow: #ECC33F;
$petal-yellow-shade: #E19C34;
$bird-body: #89ADBB;
$bird-tail: #59718B;
$bird-head: #D0DFE2;

%pos-relative_m-auto{
  margin: auto;
  position: relative;
}

%pseudo_before-after{
  content: '';
  display: block;
}

body { overflow-x: hidden; }

.canvas{
  border: solid 3px $bg;
  width: 800px;
  height: 500px;
  margin: 100px auto;
  position: relative;
}

.grass {
  background-color: $grass;
  height: 16px;
  width: 450px;
  z-index: 10;
  position: absolute;
  left: 50%;
  bottom: 40px;
  transform: translateX(-50%);
}

.tree {
  @extend %pos-relative_m-auto;
  background-color: $tree-body;
  height: 105px;
  width: 100px;
  top: 340px;

  &:before {
    content: '';
    display: block;
    position: absolute;
    width: 40px;
    height: 30px;
    z-index: 4;
    bottom: 5px;
    left: 30px;
    background: $tree-body;
  }
}

.tree__top {
  @extend %pos-relative_m-auto;
  height: 12px;
  background: $tree-top;
  width: 120px;
  left: -10px;
  top: -10px;
  border-radius: 10px 10px 0 0;
  z-index: 4;

  &:after {
    content: '';
    display: block;
    position: absolute;
    left: 10px;
    width: 100px;
    background: $tree-body;
    height: 10px;
    top: 12px;
    z-index: 3;
  }
}

.tree__face {
  @extend %pos-relative_m-auto;
  top: 7px;
  z-index: 3;
}

.tree__leye {
  position: absolute;
  height: 10px;
  width: 10px;
  background-color: $tree-eye;
  top: 15px;
  left: 30%;
  border-radius: 100%;

  &:after {
    content: '';
    display: block;
    position: relative;
    height: 8px;
    width: 25px;
    top: -16px;
    left: -10px;
    background: $tree-brows;
    border-radius: 20px;
  }
}

.tree__reye {
  height: 10px;
  width: 10px;
  background-color: $tree-eye;
  position: absolute;
  top: 15px;
  left: 60%;
  border-radius: 100%;

  &:after {
    content: '';
    display: block;
    position: relative;
    height: 8px;
    width: 25px;
    top: -16px;
    left: -4px;
    background: $tree-brows;
    border-radius: 20px;
  }
}

.tree__mouth{
  height: 50px;
  width: 20px;
  top: -18px;
  border-radius: 30px;
  @extend %pos-relative_m-auto;
  border: solid 5px $tree-shade;
  border-color: transparent transparent $tree-shade transparent;

  &:before{
    content:'';
    display:block;
    width:5px;
    height:5px;
    background: $tree-shade;
    border-radius:50%;
    top: 46px;
    left: -9px;
    @extend %pos-relative_m-auto;
  }
  &:after{
    content:'';
    display:block;
    width:5px;
    height:5px;
    background: $tree-shade;
    border-radius:50%;
    top: 41px;
    left: 9px;
    @extend %pos-relative_m-auto;
  }
}

.tree__shade1 {
  z-index: 1;
  height: 110px;
  width: 15px;
  position: relative;
  left: 0px;
  top: -70px;
  // border-bottom-right-radius: 60%;
  background: $tree-shade2;

  &:before {
    content: '';
    display: block;
    z-index: 1;
    height: 100px;
    width: 120px;
    position: absolute;
    border: solid 15px ;
    border-color: transparent $tree-shade2 transparent transparent;
    box-sizing: border-box;
    border-radius: 50%;
    bottom: -7px;
    right: -5px;
    transform: rotate(28deg);
  }
}

.tree__shade2 {
  z-index: 1;
  height: 110px;
  width: 15px;
  position: absolute;
  top: 0;
  left: 15px;
  // border-bottom-right-radius: 60%;
  background: $tree-shade3;

  &:before {
    content: '';
    display: block;
    z-index: 3;
    height: 90px;
    width: 120px;
    position: absolute;
    border: solid 15px ;
    border-color: transparent $tree-shade3 transparent transparent;
    box-sizing: border-box;
    border-radius: 50%;
    bottom: -7px;
    right: -5px;
    transform: rotate(30deg);
  }

  &:after {
    content: '';
    display: block;
    z-index: 2;
    height: 20px;
    width: 20px;
    position: absolute;
    bottom: 0;
    left: 1px;
    background: $tree-body;
  }
}

.tree__shade3 {
  z-index: 2;
  height: 110px;
  width: 15px;
  position: absolute;
  top: 0;
  right: 15px;
  // border-bottom-left-radius: 60%;
  background: $tree-shade3;

  &:before {
    content: '';
    display: block;
    z-index: 3;
    height: 90px;
    width: 120px;
    position: absolute;
    border: solid 15px ;
    border-color: transparent transparent transparent $tree-shade3;
    box-sizing: border-box;
    border-radius: 50%;
    bottom: -6px;
    left: -5px;
    transform: rotate(-30deg);
  }
  &:after {
    content: '';
    display: block;
    z-index: 2;
    height: 20px;
    width: 20px;
    position: absolute;
    bottom: 0;
    left: 0;
    background: $tree-body;
  }
}

.tree__shade4 {
  z-index: 1;
  height: 110px;
  width: 15px;
  position: absolute;
  top: 0;
  right: 0;
  // border-bottom-left-radius: 60%;
  background: $tree-body;

  &:before {
    content: '';
    display: block;
    z-index: 1;
    height: 90px;
    width: 120px;
    position: absolute;
    border: solid 15px ;
    border-color: transparent transparent transparent $tree-body;
    box-sizing: border-box;
    border-radius: 50%;
    bottom: -6px;
    left: -5px;
    transform: rotate(-30deg);
  }
}

.tree__shade5 {
  content: '';
  display: block;
  height: 40px;
  width: 15px;
  background: $tree-shade4;
  position: absolute;
  bottom: -10px;
  left: 43px;
  border-radius: 20px;
  z-index: 5;

  &:before {
    content: '';
    display: block;
    height: 15px;
    width: 15px;
    background: $tree-shade4;
    position: absolute;
    border-radius: 40%;
    bottom: 4px;
    left: 7px;
  }
}

.tree__trunk1 {
  position: absolute;
  z-index: -1;
  height: 50px;
  width: 40px;
  border: solid 15px;
  border-color: transparent transparent $tree-body transparent;
  border-radius: 50%;
  top: 0;
  left: -35px;
  transform: rotate(30deg);

  &:before {
    content: '';
    height: 15px;
    width: 15px;
    position: absolute;
    display: block;
    background: $tree-body;
    border-radius: 100%;
    left: -7px;
    bottom: -5px;
    transform: rotate(-30deg);
  }
}

.tree__trunk2 { 
  position: absolute;
  z-index: -1;
  height: 50px;
  width: 70px;
  border: solid 15px;
  border-color: transparent $tree-trunk $tree-trunk $tree-trunk;
  border-radius: 50%;
  bottom: -8px;
  right: -85px;
  transform: rotate(5deg);

  &:before {
    @extend %pseudo_before-after;
    position: absolute;
    height: 16px;
    width: 16px;
