    top: -5px;
    right: -4px;
    transform: rotate(-5deg);
    border-radius: 50%;
  }
}

.tree__trunk3 {
  position: absolute;
  z-index: -1;
  height: 70px;
  width: 80px;
  border: solid 12px;
  border-color: transparent transparent $tree-trunk $tree-trunk;
  border-radius: 50%;
  top: -40px;
  right: -60px;
  transform: rotate(-40deg);

  &:before {
    @extend %pseudo_before-after;
