  left: 112px;
  top: 75px;
  transform: rotate(25deg);
}
.tree__trunk3__leaf3 {
  position: absolute;
  height: 14px;
  width: 18px;
  background: $stem-shadow;
  border-radius: 100px 0;
  left: 95px;
  top: 95px;
